  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0129440 contains raw underway
  meteorological, navigational, optical, physical, profile and time series data logged
  by the Scientific Computer System (SCS) aboard NOAA Ship Pisces in the Gulf of Mexico
  and North Atlantic Ocean from 2015-05-12 to 2015-06-10. Office of Marine and Aviation
  Operations (OMAO) personnel aboard the ship submitted these data and associated
  metadata to NODC. In addition, NODC Accession 0129440 contains supplementary cruise-level
  metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
  and NODC personnel developed the automated process to archive these data under the
  auspices of the NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"owner_org\":
